import React from 'react';
import classnames from 'classnames';
import TelephoneInput from './primary_components/TelephoneInput';
import TextInput from './primary_components/TextInput';

const InstitutionComponent = ({ id,onChange, onBlur, nameLabel,errorName, errorTelphone, errorEmail }) => {
    const classes = classnames(
        'elements-group',
        'div-group'
    );
    return (

        <fieldset id="instituicao" className={classes}>
            <legend className="title-box-element">INSTITUIÇÃO VISITANTE</legend>

            <TextInput
                id={id}
                type="text"
                label={nameLabel}
                placeholder={nameLabel}
                error={errorName}
                onChange={onChange}
                onBlur={onBlur}
            />
            <div className="input-group-row">
                <TelephoneInput
                    id="telefoneInstituicao"
                    type="text"
                    label="Telefone da Instituição visitante:"
                    placeholder="Telefone da Instituição visitante"
                    error={errorTelphone}
                    onChange={onChange}
                    onBlur={onBlur}
                    mask={['(', '0', /\d/, /\d/, ')', ' ', /\d/, /\d/, /\d/, /\d/, '-', /\d/, /\d/, /\d/, /\d/], ['(', '0', /\d/, /\d/, ')', ' ', /\d/, /\d/, /\d/, /\d/, /\d/, '-', /\d/, /\d/, /\d/, /\d/]}
                />
                <TextInput
                    id="emailInstituicao"
                    type="email"
                    label="E-mail da Instituição visitante:"
                    placeholder="E-mail da Instituição visitante"
                    error={errorEmail}
                    onChange={onChange}
                    onBlur={onBlur}
                />
            </div>
        </fieldset>
    );
};

export default InstitutionComponent;
